import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import {Component, Inject, OnInit} from '@angular/core';
import {DataService} from '../../services/data.service';
import jsPDF from 'jspdf';

@Component({
  selector: 'app-vales',
  templateUrl: './vales.component.html',
  styleUrls: ['./vales.component.css']
})
export class ValesComponent implements OnInit {

  constructor(public dialogRef: MatDialogRef<ValesComponent>,
    @Inject(MAT_DIALOG_DATA) public data: any, public dataService: DataService) { }

  ngOnInit(): void {
  }

  onNoClick(): void {
    //Cerrar dialogo
    this.dialogRef.close();
  }

  confirmPrint(): void {
    //MÃ©todo para imprimir
    const doc = new jsPDF("portrait");

    //Nombre del documento
    var salida = "vales_" + this.data.nombre_distribuidor + "_" + this.data.apellido_distribuidor + "_" + this.data.id_vale + "_" +".pdf";
    var tipo_vale = "";
    var monto = this.data.monto_vale / this.data.cantidad;
    var contador = 0;
    //Declarar valores fijos e imagenes en base64
    var logo_ljeans = "data:image/png;base64,"
    
    if(this.data.tipo_vale === "E"){
      tipo_vale = "Vale electrÃ³nico";
    }
    else if(this.data.tipo_vale === "L"){
      tipo_vale = "LCard";
    }
    else{
      tipo_vale = "Vale fÃ­sico";
    }
    // Hacer un for de impresiÃ³n de vales
    for(var i = 0;i<this.data.cantidad;i++){
      contador = contador + 1
      if(contador === 1 ){
        doc.addImage(logo_ljeans, 'JPEG', 20, 10, 80, 25);
        
        doc.setFontSize(12);
        doc.text("Fecha de vigencia: ",103, 15);
        doc.text(this.data.fecha_limite,103,20);

        doc.setFontSize(12);
        doc.text("Folio: " + this.data.id_vale, 103, 34);

        doc.setFontSize(14);
        doc.text("Cliente: " + this.data.nombre_distribuidor + " " + this.data.apellido_distribuidor, 20, 45);

        doc.setFontSize(14);
        doc.text("Monto: " + monto + "                                         " + tipo_vale, 20, 53);
      }
      else if(contador === 2 ){
        doc.addImage(logo_ljeans, 'JPEG', 20, 80, 80, 25);
        
        doc.setFontSize(12);
        doc.text("Fecha de vigencia: ",103, 85);
        doc.text(this.data.fecha_limite,103,90);

        doc.setFontSize(12);
        doc.text("Folio: " + this.data.id_vale, 103, 104);

        doc.setFontSize(14);
        doc.text("Cliente: " + this.data.nombre_distribuidor + " " + this.data.apellido_distribuidor, 20, 115);

        doc.setFontSize(14);
        doc.text("Monto: " + monto + "                                         " + tipo_vale, 20, 123);
      }
      else if(contador === 3 ){
        doc.addImage(logo_ljeans, 'JPEG', 20, 160, 80, 25);
        
        doc.setFontSize(12);
        doc.text("Fecha de vigencia: ",103, 165);
        doc.text(this.data.fecha_limite,103,170);

        doc.setFontSize(12);
        doc.text("Folio: " + this.data.id_vale, 103, 184);

        doc.setFontSize(14);
        doc.text("Cliente: " + this.data.nombre_distribuidor + " " + this.data.apellido_distribuidor, 20, 195);

        doc.setFontSize(14);
        doc.text("Monto: " + monto + "                                         " + tipo_vale, 20, 203);
      }
      
      if(contador === 3 && i+1 < this.data.cantidad){
        doc.addPage();
        contador = 0;
      }
    }
    //Generar documento
    doc.save(salida);
  }
}
